import * as React from 'react';
import Box from '@mui/material/Box';
import { alpha, styled } from '@mui/material/styles';
import './Myaccount.css'
import { Input } from '../../Sup Components/Input/Input';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
function Myaccount() {
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
  
  };
  const CssTextField = styled(TextField)({
    '& label.Mui-focused': {
      color: 'green',
    },
    '& .MuiInput-underline:after': {
      borderBottomColor: 'green',
    },
    '& .MuiOutlinedInput-root': {
      '& fieldset': {
        borderColor: 'red',
      },
      '&:hover fieldset': {
        borderColor: 'yellow',
      },
      '&.Mui-focused fieldset': {
        borderColor: 'green',
      },
    },
  });
 
  return (
    <Box style={{marginTop: '5px',display: 'flex',justifyContent: 'center', alignItems: 'center' }} >
      <Box style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', maxWidth: '100%', overflow: 'auto', }}> 
    <Box className="box1">
  
     <Box className="mainContainer">

                <Box className="inputcontainer" sx={{backgroundColor: "black"}}>
                </Box>
                <Box  sx={{ height: "100%",width: "50%"}}>
                        
                         <Box className="logincontainer">
                         
                         <Box className="login" >
                         <h2>Login</h2>
                         </Box>
                        
                         <Box component="form" onSubmit={handleSubmit} noValidate sx={{ margin:"0px" }}>
                         <CssTextField label="Custom CSS" id="custom-css-outlined-input" />
      <ValidationTextField
              margin="normal"
              required
              id="standard-basic"
               label="Email Address"
               variant="filled"
               size="small"
    
              name="email"
              autoComplete="email"
              autoFocus
            />
            <br/>
            <TextField
              margin="normal"
              required
              name="password"
              label="Password"
              variant="filled"
              size="small"
              autoComplete="current-password"
             
            />
            <FormControlLabel
              control={<Checkbox value="remember" color="primary"sx={{color:"purple"}} />}
              label="Remember me"
            />
            <br/>
            <Button
              type="submit"
              
              variant="contained"
              sx={{ mt: 2, mb: 2 }}
            >
              Sign In
            </Button>
            <Grid container >
              <Grid item xs>
                <Link href="#" variant="body2" sx={{color:"purple"}}>
                  Forgot password?
                </Link>
              </Grid>
              <Grid item>
                <Link href="#" variant="body2" sx={{color:"purple"}}>
                  {"Don't have an account? Sign Up"}
                </Link>
              </Grid>
            </Grid>
          </Box>
                    
                    </Box>
                         </Box>

                
               </Box>
     
     </Box>
      </Box> 
      </Box> 
     
  );
}
export default  Myaccount;
